"description": "Personalized Custom Mini Oak Barrels, perfect for the home bar or professional distillery.  FREE SHIPPING WITHIN THE CONTINENTAL USA! Worldwide Shipping Available! (See Exclusions) American White Oak barrels just like those used in distilleries in smaller sizes to allow you to age spirits to perfection in a fraction of the time! Order blank or personalized. See barrel option info and descriptions on bottom of page. Matching accessories available (see photos).✩Stand, Bung and Spigot are included.✩ \n\n☞TO PERSONALIZE YOUR BARREL, WE NEED THIS INFO☟\n❶ Finish and Hoop Selections  (Select from Drop Down Menu)  \n❷ Personalization: (Please refer to 2nd photo for design info)\nNAME: \nEST. YEAR:  \n\n✪COPY & PASTE THE ABOVE PERSONALIZATION IN THE NOTE TO SELLER AREA DURING CHECKOUT TO ENSURE WE GET ALL INFO NEEDED. PLEASE BE SURE TO ENTER YOUR PERSONALIZATION EXACTLY AS YOU WANT IT TO BE ENGRAVED! IF YOU WISH TO OMIT A LINE, SIMPLY ENTER &quot;BLANK&quot; FOR THAT LINE. FOR TEMPLATE DESIGN CHANGES, PLEASE CONTACT US PRIOR TO PLACE A CUSTOM ORDER.\n\n❸ CLEANING KITS (OPTIONAL): https://www.etsy.com/listing/169199812/care-and-cleaning-kits-for-your-custom?ref=shop_home_active&ga_search_query=CLEANING\n\n❹ NEED YOUR BARREL IN A HURRY? ADD RUSH OPTIONS:\nWe offer Rush Production and/or Rush Shipping options. Please be sure to see shop banner for production and cutoff times and add one or both options, depending on what you need. Rush shipping can be selected during checkout. Rush production can be added here: https://www.etsy.com/listing/172997767/production-rush-get-your-barrels-goods?ref=shop_home_active_1&ga_search_query=RUSH  Not sure what you will need, please contact us.\n\n\n\n✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪\n ☟☟☟☟☟☟☟ ☟☟☟ PRODUCT & OFFER DESCRIPTIONS ☟☟☟☟☟☟☟☟\n✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪✪\n\n✪BLANK, PERSONALIZED OR CUSTOM- WHAT’S THE DIFFERENCE?\n1) BLANK BARREL: A blank, non-personalized barrel with no design.\n2) PERSONALIZED: The design shown above, with YOUR personalization.\n3) CUSTOM-YOUR DESIGN: You can order a barrel using your own design here: https://www.etsy.com/shop/BootlegBarrels?section_id=14695743&ref=shopsection_leftnav_8 See Art Req!\n4) CUSTOM-WE DESIGN: Contact us PRIOR to ordering. We are capable of creating just about any design you can imagine so just let us know what you are wanting and we’d be happy to provide a quote. Our minimum art fee is $35 for something basic or all text and goes up from there based on intricacy and time estimated to complete your artwork. Requires purchase of custom barrel, art fee and a custom listing since cost will vary based on design desired.\n\n\n✪FINISH AND HOOP OPTIONS:\n-Unfinished/Steel: Unfinished Barrel with Steel Hoops\n-Finished/Steel: Finished barrel with Steel Hoops\n-Unfinished/Black: Unfinished Barrel with Black Hoops\n-Finished/Black: Finished barrel with Black Hoops\nWHAT’S THE DIFFERENCE? Finished barrels will have a few light coats of a clear, water based finish applied to them.  Unfinished barrel will not have this finish applied.  Steel hoops are steel.  Black hoops are steel hoops coated in black.\n\n✪ RUSH PRODUCTION & RUSH SHIPPING OPTIONS: To be fair to all customers, we offer standard and rush options to all customers. Unless rush production has been ordered, all orders are produced in the order in which they are received to be fair to all customers. Upgrading shipping will expedite your shipping. Adding a rush production will place your order into the rush production queue ahead of the line. You can select one or both options based on what you need and one is not required to purchase the other. Requesting rush options in the note to seller area will not expedite your order unless you have added a rush to your order. We had to implement this policy to be fair to all customers since 85% of customers ordering have a specific date in mind that they&#39;d like their order. All current production times, order cutoff dates, etc. are all posted in the shop banner. \n\n✪ BARREL DIMENSIONS:\n1 Liter 6.5 x 4.5 x 4.5 inches\n2 Liter 7.5 x 5 x 5 inches\n3 Liter 8.5 x 5.5 x 5.5 inches\n5 Liter 9.5 x 6.5 x 6.5 inches\n10 Liter 12 x 8 x 8 inches\n20 Liter 15 x 10.5 x 10.5 inches\n*DIMESIONS ABOVE DO NOT INCLUDE STAND HEIGHT AND WIDTH. If needing to fit within a specific space, please contact us and we can provide measurements including the stand. Although it doesn&#39;t seem like there is a great difference in sizes, a 1 liter will hold an entire liter more and so on. Larger barrels also come with larger stands to ensure everything looks proportionate.\n\n✪FREE SHIPPING PROMOTION:\nFree Standard Domestic Shipping within the Continental USA only. Excludes orders shipping to AK, HI, PR or internationally, as shipping is higher to ship to these locations. Excludes all expedited options. We reserve the right to ship the most economical way, (most often USPS 1st class) and therefore cannot guarantee a specific delivery date with free shipping offer. If ordering multiple items, we may split your order into multiple shipments to reduce shipping costs. \n\n✪ ENGRAVING INFO:\nEach design will state what lines can be personalized free. Copy and paste personalization lines and enter your personalization in note to seller area. If you selected personalized and did not enter personalization- no worries, you will be contacted to get the needed info prior to shipping your order :) If you ordered a blank barrel, but entered personalization, your barrel will arrive blank-you will only get a personalized barrel if you ordered a personalized barrel. Please be sure to enter all personalization exactly as you want it engraved. Note that some fonts used in certain designs do not always have both upper and lower case characters. In this case all letters will be uppercase regardless of how it is entered since this is all the font allows. Please refer to the images in each listing for reference. \n\n✪ INTERNATIONAL SHIPPING:\nWe ship to most destinations worldwide! Please be aware that if we are unable to ship to your location, we will notify you, cancel your order and refund you in full. Shipping calculation errors may occur with international shipping on Etsy that are out of our control and we accept no responsibility for these errors. If ordering multiple items, we reserve the right to ship in multiple packages to reduce shipping costs. With the lowest cost shipping selected, we reserve the right to ship the most economical way, (usually USPS 1st class) and other carriers may be used regardless of what carrier method is stated during checkout. In the event shipping is much higher than shown we will contact you and offer to invoice for the difference or cancel your order. If you decide to cancel, we will issue you a full refund. We want to continue to offer international shipping, so thank you for your understanding.\n\nPlease be sure we have all information needed to create your one of a kind barrel. If we do not receive all necessary information to create your custom barrel, your order will be placed on hold so we can contact you. Please be sure to include all info~ we really want you to love your custom barrel!  \n\n☎ Have Questions or need help creating your customized barrel?  There&#39;s a lot of options, so please feel free to contact us and we will be happy to assist you.\n\nThank you for your business!  We appreciate each and every one of you :)\n\nCSB_200",
