"description": "Our Customized Whiskey Glasses can be etched on one or both sides to match the theme of your wedding, bar, man cave or kitchen.  Personalize with text, clipart and/or logos. Laser Engraving and Deep Sand Blasting will reveal a crisp white image.  The glasses are sturdy and are sure to last for years!  The engraving will not wear off or fade over time and they are dishwasher safe too!\n\nGreat Gift Idea for:\n- Groomsmen Gift / Best Man Gift\n- Wedding Party Gift / Bridal Party Gift\n- Bachelor Party Gift / Bachelorette Party Gift\n- Groom Gift\n\n♦ Laser Engraved for precise image and Sand Blasted for deep etched look and feel\n♦ Engraved Text, Logos and/or Clipart\n♦ Dishwasher Safe\n\n**HOW TO ORDER**\n1. Choose the quantity tier based on the quantity you will need for your event. This will apply the appropriate quantity discount.  For example, if you would like 12 items, choose the 11-30 quantity tier in the drop down list.  If the quantity needed is more than what is allowed in the quantity tier, please contact me for a personalized quote and reserved Etsy listing using the &#39;Request Custom Order&#39; link above.\n\n2. Choose the actual quantity needed in the drop down list and click add to cart.  The quantity chosen and the quantity category MUST match or your order will not be processed and will be cancelled unless appropriate payment is received.\n\n3. Don’t forget to leave a note in your order with the date of your event so I am able to get your order done and to you in time.\n\n**********\n\n★ EXTRAS \nCheck our EXTRAS category for more add ons, such as greeting cards and rush order processing.\n\n★  PERSONALIZATION\nAfter your purchase is complete, please submit all photos and personalization details (text, fonts, cliparts, logos, etc.) using the form mentioned above in the listing OR through an Etsy conversation.  I will match the form and/or conversation with the order. \n\n★  NO LIMIT GUARANTEE\nPersonalize our gifts with our No Limit Guarantee!  Our gifts are 100% customizable.  We don’t have any character or line limits and no strict image requirements.  I will work with you to design your item the way you request it.  My only limit is the size of the piece and if my machines will be able to do it.  I can resize most text and images to fit on the pieces instead of placing limitations on personalization.\n\n★  NEED THIS FAST? \nUpgrading your shipping does not change the processing time. If you need it sooner, you can purchase rush shipping using this listing here:\n\n★  LARGE QUANTITY ORDERS\nPictureIt Creations does offer quantity discounts on larger orders of 5 or more.  Please contact me for a custom quote for the quantity you need and an accurate shipping quote.\n\nCombined shipping is available when purchasing multiple items from our shop and is calculated at checkout.  When shipping outside of the United States, please contact me for an accurate shipping quote prior to purchase.\n\n★  SHIP DIRECTLY TO RECIPIENT\nPictureIt Creations can ship directly to the recipient as long as you have added the appropriate shipping address in the order.  A shipper is included in all orders, however it does not show any pricing.  If the recipient is outside of the United States, all international shipping policies apply.  For more information, please reference our policies page.\n\n★  REFUNDS & EXCHANGES\nDue to the personalization of our items, we do not offer refunds & exchanges, including customers in the EU.  For information, please reference our policies page.\n\n★  Be sure to follow me on Facebook, Twitter, Pinterest & Instagram to keep up with all of the gift ideas, discounts and giveaways!\nhttp://www.facebook.com/pictureitcreations\nhttp://www.twitter.com/justpictureit\nhttp://www.pinterest.com/apictureitgift\nhttp://instagram.com/pictureitcreations",
