"title": "PictureIt Creations",
"announcement": "Personalize gifts to celebrate all of life&#39;s special moments.  Our unique, one-of-a-kind gifts are handmade and inspired by you!  Custom orders always welcome!  Subscribe to our newsletter for more discounts and sales! http://eepurl.com/FG2XP\r\n\r\nFor more listings for businesses and crafters, visit my other Etsy shop:\r\nhttp://www.originsbypic.etsy.com",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your order!\r\n\r\nPlease submit any personalization details (if applicable) through an Etsy conversation or using the form mentioned in the listing.  Details should be sent within 24 hours of placing the order to be sure the right details are matched with the correct order.\r\n\r\nWhen your order has been processed and shipped, you will be getting a notification with your tracking number.",
"digital_sale_message": null,
