"policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
"policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
"policy_refunds": "I DON'T ACCEPT RETURNS, EXCHANGES, OR CANCELLATIONS\nBut please contact me if you have any problems with your order.",
"policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n\nSALES TAX\nOn Michigan orders, we do charge a 6% sales tax.\n\nLARGE QUANTITY ORDERS\nPictureIt Creations does offer quantity discounts on larger orders of 5 or more.  Please contact me for a custom quote for the quantity you need and an accurate shipping quote.\n\nUS SHIPPING\nAll orders are shipped using USPS First Class, Priority or Express depending on the order & option chosen at checkout.  \n\nPictureIt Creations is not responsible for lost, stolen or damaged packages due to courier error.  Once a package is shipped, it is the buyer’s responsibility to track the package, contact me within 3 business days past the expected date of delivery, AND contact the courier service in your area to locate the package and/or file a claim.  Shipping fees do not include insurance, however it is available by request for an additional fee.\n\nIf a package is returned, add&#39;l shipping fees will be collected before it is shipped again.  Buyer is responsible for return charges. Refunds will not be issued for returned packages.\n\nINTERNATIONAL SHIPPING\nPictureIt Creations does ship internationally via USPS First Class International or International Priority depending on the item.  If I don’t have shipping available for your delivery address, please contact me for a quote.  PictureIt Creations is not responsible for any customs taxes or fees.  EU customers do NOT have the option to return customized items.  The item will not be marked as a gift and the value will be accurately disclosed on the customs forms.\n\nIf a package is returned to us, additional shipping fees will be collected before it is shipped again.  Refunds will not be issued for returned packages. Buyer is responsible for all return package charges in all circumstances.\n\nSHIP DIRECTLY TO RECIPIENT\nPictureIt Creations does ship directly to the recipient as long as you have added the appropriate shipping address in the order.  A shipper is included in all orders, however it does not show any pricing.\n\nIf the recipient is outside of the United States, the customs taxes and fees will be the recipient’s responsibility.  Please contact me for an accurate shipping price if international shipping is required.\n\nIf a package is returned to us, additional shipping fees will be collected before it is shipped again.  Refunds will not be issued for returned packages.\n\nNATURAL MATERIALS DISCLOSURE\nMost of the materials I work with are natural materials.  Their color, shape, size, grain, texture, overall look and how they react to the processes of sandblasting, engraving, sublimation, etc. may vary slightly from the images you see in my listings.  I do check for any defects, fractures or anything that would take away from the look and feel of the final piece before I process any orders.  Some of the pieces I personalize are also handmade and cannot be duplicated as to why some may look slightly different.  Because I do not have any control over natural materials, I do not issue refunds or exchanges based on these issues.\n\nDAMAGED/INCORRECT PERSONALIZED ITEMS\nIf a personalized item is damaged or incorrect, please contact me within 3 days and I will get another one out to you ASAP.  You will need to send a photo of the damaged/incorrect.  There will be no changes made to these replacement orders as they will go out exactly as requested in the original order.\n\nPictureIt Creations is not responsible for spelling errors, punctuation, typographical errors, etc. on personalization.  If the personalization information was submitted incorrectly, please contact me immediately to work on terms for purchasing a new item.  Please double check all personalization details at the time of ordering, as we do not correct these errors.  Submitting your order is agreeing to these terms.\n\nREFUNDS, EXCHANGES, CHANGES & CANCELLATIONS\nDue to the personalization of each item, we do not offer refunds or exchanges.  Customers in the EU will also not be authorized to return/exchange items under the right of withdrawal as this rule does not apply to personalized items.\n\nOrders cannot be cancelled or changed once they have begun to be processed. If you have decided to cancel your order, please contact me immediately to see if it&#39;s possible.\n\nDEADLINES\nIf you have a deadline for your gift, such as a wedding or gift date, please note that in the Notes section of your order.  PictureIt Creations will work hard to get your item to you in time.  If your gift date is very soon, please contact me to confirm I can get it out in time prior to purchase.  Be sure to note the specific item you’re looking for and the quantity in the message.\n\nYou can purchase RUSH Order Processing here: https://www.etsy.com/listing/288759365/rush-order-on-personalized-gifts-from\n\nSUBMITTING PERSONALIZATION INFORMATION\nAfter a purchase is complete, please sumbit all photos and personalization details (text, fonts, cliparts, logos, etc.) using the form mentioned in the listing or through an Etsy conversation. I will match the form and/or conversation up with the order.  I can prepare a proof of the layout prior to engraving for approval upon request only.\n\nPictureIt Creations is not responsible for spelling errors, punctuation, typographical errors, etc. on personalization of any item.  Please double check all personalization details at the time of ordering as we do not correct these errors.  Submitting your order is agreeing to these terms.",
