"title": "All things vintage ~ china, glassware, barware and more",
"announcement": "WELCOME !!!\r\nI LOVE hunting for vintage items~ my favorites are depression glass, milk glass & antique china. Recently, I have taken an interest in pairing together my finds for sets of mismatched china, glassware and flatware! The collection you see in my shop are the things I love. Take time to browse the MANY items I have listed~  I&#39;m sure there is something that you can&#39;t live without ;)",
