"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for you business!  We hope you enjoy your purchase!  Purchases will be shipped via UPS.  We will send you a UPS tracking number when your order is ready to be shipped. \r\n\r\n***IF THE ITEM IS A CUSTOM ORDER PLEASE REVIEW RECEIPT FOR ESTIMATED SHIPPING TIMEFRAME*****\r\n\r\n",
"digital_sale_message": null,
"last_updated_tsz": 1476807931,
"listing_active_count": 28,
"digital_listing_count": 0,
"login_name": "RockCreekFurnitureCo",
"accepts_custom_requests": true,
"policy_welcome": null,
"policy_payment": "We accept money orders and PayPal for payment.  Items will be shipped only if the payment has cleared. \r\n\r\nSales Tax: We are required to charge sales tax to all customers located in our state of business, Colorado.",
"policy_shipping": "We us UPS for all of our shipping and we ship from Colorado.  As soon as your item is ready, the Track Package button will be activated on your order.  You can check the tracking by going to Purchases & reviews under the You menu.\r\n\r\nItems are shipped within 1-2 weeks of payment clearing unless noted otherwise.\r\n\r\n*** Please review receipt at checkout for all custom orders for shipping timeframe ***\r\n\r\nChange of Address:\r\nEtsy does not allow us to go in and update the address after an order is placed.  If the item is being sent to a different address please make sure to update the address when checking out or make note of it in the “Notes to Seller” section during checkout.\r\n\r\nExpedited Shipping:\r\nIs available when our production volume allows us to make the item(s) and ship them out in the timeframe needed.   Please contact us if you are interested in expedited shipping and we will quote you a rate. \r\n\r\nDamaged Items:\r\nIf your item is broken or damaged in transit please send us a photo of the item for documentation.  We will replace or fix the item if it was broken or damaged by our shipping service as long as we receive notification within 3 days of delivery date according to UPS tracking.  We will file a claim if warranted with our shipping service.\r\n",
"policy_refunds": "Refunds:\r\nWe want you to be completely satisfied with your purchase.  If for some reason you aren’t happy with your purchase, please contact us within 48 hours of receiving your items to discuss options.  We do not accept returns on engraved items.  Once engraved, items cannot be resold.\r\n\r\nEngraving Errors:\r\nIf we make a mistake on your order, please contact us immediately so we can correct the error or replace your item with correction at no charge.  If the mistake was yours (i.e. the information supplied at checkout was incorrect – spellings, dates, etc.), then we cannot give a refund.  However, if you would like to reorder please let us know and we can offer a discount.  We want our customers to be happy.\r\n\r\nCancellations:\r\nIf you c contact us within 24 hours of placing the order and production has not begun on your item, we are willing to cancel your order and issue you a refund.  After 24 hours (or sooner if we have started production), we are unable to issue you a refund if your order is a custom item.  If the item has no personalization on it and we haven’t already sent it out we will issue you a refund if we notified within 24 hours.\r\n",
"policy_additional": "Production Time:  \r\nOur production timeframe can vary depending on the current order volume.  It most case the production time listed on the receipt is accurate. If we are not able to meet that timeframe we will contact you via the messaging system on Etsy.  During most of the year, our production time is approximately 1-2 weeks for most products.  Our larger products can take up to 3-4 weeks.\r\n\r\nHoliday Orders: \r\nOur busiest time of year is the holiday season.  Please read announcement placed on our front page for estimated shipping time and order cut offs for guaranteed shipping.  During this time your receipt might indicate a longer shipping time frame but if your order has been placed prior to the cut off and we have not contacted you to  indicate a different shipping time we are working hard to get the order out for a December 24th or earlier delivery.   \r\n\r\nRush Orders:\r\nIf you have a rush order, please send us a message prior to ordering so we can make sure we can meet your deadline.  Please see expedited shipping information.  Most rush orders will require expedited shipping.\r\n\r\nCustom Orders:\r\nWe love to help customer ideas come to life!  If you have a custom request please send us a convo.  An additional charge of $10.00 will be accessed at the time of purchase.\r\n\r\nGift Notes:\r\nThis is free of charge, however please note that the only information we receive on an invoice is your Etsy username and email address associated with your Etsy account.  Please make sure to include the gift note information in the “Notes to Seller” section during checkout.\r\n\r\n\r\n**We do not include invoices in any of our shipments.\r\n**  Decorations not included unless noted.\r\n**  All wine barrel heads used are unique.  We attempt to take off as little as possible from the barrel head used to keep them one of a kind for each purchase.  Therefore, some barrel heads will still have some original branding.\r\n\r\nPlease contact us for further information regarding wholesale.",
