"shop_name": "EverythingEtchedAZ",
"user_id": 38961390,
"creation_tsz": 1383065727,
"title": "Beautiful Personalized Gifts For Every Occasion",
"announcement": "Personalized drop boxes and etched glassware are handcrafted and available in a variety of sizes, shapes and thematic styles. They’re the perfect gift for weddings, anniversaries, graduations, birthday, or just for you!\n\nWe are here Monday-Friday, 8-5 MST to answer all your questions.\n\nDrop A Cork!\n\nPop a cork and make a toast! What a great tradition.  But when all the vino has been quaffed and the evening has come to an end, what of all of those tired, dried up corks?  Do they deserve to simply be swept aside, treated like common everyday garbage?\n\nWe think not!\n \nIn deference to all of those noble corks who have dedicated their lives to preserving the quality and complexity of our fine fermented friend, we here at Everything Etched have created a brand new tradition that we have aptly named…Drop a Cork!  \n\nWe’ve given those trusty old plugs a new place to call home with our distinctive line of beautiful, handmade Wine Cork Holder Personalized Drop Boxes: a place where we can honor their memories, our memories, and all of the good times we’ve shared and have yet to discover.\n\nSo, go ahead: Drop a Cork, Celebrate Life, and Shop! Shop! Shop!\n\n\nFor details on our Personalized Drop Boxes, the various styles, how they’re made, and how you can order a customized box of your very own please stop by our shop’s About page!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Hello! I will be on vacation until the 16th. I will open back up the shop a few days before that. You can still contact me if you have any questions at during that time. Thank you all!",
"sale_message": "Thank you for your order! \r\n\r\nIf you ordered a personalized or customized design, you will receive a design proof within 1 business day. We will send a link to your proof to the email attached to your order. Please keep an eye out for that message as I cannot ship your order out until a proof has been approved. Orders ship 1-2 days after a proof has been approved.\r\n\r\nOrders of the beer opener, wine opener, knife  or spatula will not receive a design proof, unless requested. Please sure your information is correct and contact me right away if there are errors.\r\n\r\nAll other orders will receive a confirmation when it has shipped.\r\n\r\nOur hours are Monday-Friday 8-5 MST. Messages outside this time are not monitored and will be replied to on the next business day.\r\n\r\nThanks again!\r\n\r\n-Tyler",
"digital_sale_message": null,
"last_updated_tsz": 1476809776,
"listing_active_count": 790,
"digital_listing_count": 0,
"login_name": "TheCreativeVine",
"accepts_custom_requests": true,
"policy_welcome": "Each Drop Box is handmade of pinewood and stained to the color you select. The glass front is laser etched with “Keep Calm and Drink Wine” or your own personally created phrase—I use a laser engraver as it provides the best contrast and clarity, enhancing the look of the design against a solid backdrop of corks. A drop hole is located at the top of the frame for easy wine cork deposit.*\r\n\r\n•\tDrop Box prices include: shadow box, photo transfer (if applicable), and one etched phrase; etching of custom designs and logos is available at additional cost.\r\n•\tThe standard size cork hole can be cut to your specifications, if need be.\r\n\r\nMy Drop Boxes are available in a variety of sizes, shapes, and thematic styles, making them the perfect gift for weddings, anniversaries, birthdays, graduations or almost any occasion… and an ideal gift just for you.\r\n\r\nIf you don’t see what you’re looking for, click on “Request Custom Order” and contact me with your questions and specifications. I’d be more than happy to create your custom design.  Custom orders are a specialty of mine!\r\n\r\nThanks for shopping Everything Etched!\r\n \r\n\r\n\r\n*Corks Not Included  (I love my wine, but come on… I can only drink so much!)\r\n",
"policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
"policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
"policy_refunds": "I GLADLY ACCEPT RETURNS AND EXCHANGES\nJust contact me within: 5 days of delivery\nShip returns back to me within: 30 days of delivery\n\nI DON'T ACCEPT CANCELLATIONS\nBut please contact me if you have any problems with your order.\n\nTHE FOLLOWING ITEMS CAN'T BE RETURNED\nBecause of the nature of these items, unless they arrive damaged or defective, I can't accept returns for:\n- Custom or personalized orders\n- Perishable products (like food or flowers)\n- Digital downloads\n- Intimate items (for health/hygiene reasons)\n\nCONDITIONS OF RETURN\nBuyers are responsible for return shipping costs.\nIf the item is not returned in its original condition, the buyer is responsible for any loss in value.",
"policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n- For legal reasons (like paying taxes)",
