"announcement": "CURRENT PRODUCTION TIME IS 7-9 &#39;&#39;BUSINESS DAYS&#39;&#39;",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "We are so excited to announce that all of our hard work within our shop has allowed us the opportunity to buy a home in the Mountains of TN for our family..!!\r\n\r\nWe have decided that putting our shop on vacation as we prepare for and complete our move is what&#39;s best for our family and customers.. \r\n\r\nPLEASE DO NOT WORRY, all orders that have already been placed will still be shipping as scheduled..\r\n\r\nWhile on our brief vacation you can follow us on Instagram @DownInTheBoondocks to keep up with our journey and be the first to see brand new items as they are released as well as special offers..!\r\n\r\nIf you have any questions about your order feel free to convo us and we&#39;ll return your email by the end of the day.\r\n\r\nThanks!\r\nAmber & Kevin\r\n\r\n\r\nPlease click on the the blue ↓↓ &#39;Yes, Notify Me By Email&#39; ↓↓ link below to be notified as soon as we reopen..\r\n",
"sale_message": "Thank You so much For Your Purchase.! And keeping small businesses of America growing..\r\n\r\n♥ We are currently processing and shipping orders within 7-9 BUSINESS days. \r\n \r\n♥ If you order has passed it&#39;s expected ship date please allow 1-2 additional days for your order to ship this time of year is very busy for our little shop and we are working as fast as we can.. \r\n♥ You will receive an email notification with tracking info once your order has shipped.\r\n\r\nLooking for more great wedding decor priced right visit: www.downintheboondocks.com\r\n\r\nWe also L♥VE to receive photos of our products in use.! If you would like to send us a photo of our item in use PLEASE do so, we may even feature your photo in our shop as well.! \r\n\r\nFollow us on Instagram @DownInTheBoondocks for special sales and coupon codes,..!",
