"creation_tsz": 1321243755,
"title": "Mini Bottle Ornaments and USB Drives",
"announcement": "Mini Bottles of all sorts of Liquors made into Christmas Tree Ornaments and USB Drives?  Yes please!  Snowflakes and candy canes are fun, but why not express your fondness for your favorite way to warm up on a cold winter night?  Also makes a clever gift to that relative or friend who sometimes tends to have a tipple too many at the holiday party.\n\nFor more posters and photography, check out my other shop at: http://magnoliasmanor.etsy.com",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "It&#39;s summer!  Go outside and play!  Christmas ornaments will resume sale for Christmas in July, and then during the fall.",
