"accepts_custom_requests": true,
"policy_welcome": "Hey there and welcome!  These are either the coolest ornaments or the least comfortable ear rings the world has ever seen.  They&#39;re an excellent way to express your fondness for a certain brand of alcohol or as a clever gift to that relative or friend who sometimes tends to have a tipple too many at the holiday party.",
"policy_payment": "I would be glad to accept paypal or credit card.",
"policy_shipping": "I ship via US Post in sturdy, padded boxes or envelopes.  I&#39;m glad to ship internationally, but due to the unpredictability of such things, buyer is responsible for any tariffs or fees, if applied by your local government.\n\nI ship to the address provided to etsy when you make your order. Please double check to make sure your address is correct.\n\nDuring the months of November-January, you can expect your ornament to ship after about a week. Sometimes, it takes little bit longer since they&#39;re all individually handmade. The shipping estimate is only an estimate, but if you need it by a specific day please message me and I&#39;ll see what I can do. While I make every effort I can to ship on time, if you need the order by a certain date, please be sure to specify. To help you know when it&#39;s on its way, tracking numbers are provided for all orders.\n\nHow long will your ornament be in transit? View the estimated shipping time map here: https://img1.etsystatic.com/036/0/6610538/isa_760xN.7535189911_k853.jpg\n\nNeed an ornament shipped faster?  Rush processing available on some ornaments. Send me a message and I&#39;ll see what I can do.\n\nPosters:\n\nPosters are shipped rolled up and bagged through USPS in super-sturdy mailing tubes.  Unless otherwise noted, you can expect them to ship within a few days.  Tracking numbers will be provided.",
"policy_refunds": "I would be glad to refund or replace any items that arrive damaged or faulty upon their return.",
"policy_additional": "Ornaments and posters are for decorative use only and are not recommended for consumption.  Even if you&#39;re really thirsty.\r\n\r\nColors are all hand mixed.  While I do my best, they may not precisely match the pictures seen online or the color of the actual alcohol.  But they will be very very close.  Small imperfections or bubbles may be present and are a normal part of the process.  And, hey, be glad to know that that means your product was made by hand by a real person!\r\n\r\nI neither work for nor am affiliated with any liquor company or holding agency.  Copyrights remain with their respective holders.  Ornaments are modifications to licensed products.\r\n\r\nCancellation Policy: Items may be cancelled up to 4 days after ordering. After that, your ornaments are too far along being made and cancellation is not possible.",
