"description": "Whiskey Stones are a Unique and Popular gift on their own, but when they are personalized they become extra special.\n\nThis listing is 6 Engraved Whiskey Stones in a  Personalized Wood Box.  These make a great gift for Weddings, Christmas, Stocking Fillers, Birthdays, Anniversaries, Military Weddings, Whiskey Stones are always are well received gift.\n\nEach Whiskey Stone is made of 100% Soapstone right here in the USA. Only 3 are needed per drink.  Each set comes in it&#39;s own Muslin Storage bag with an instructions for use card.\n\nIncluded in the set are -\n\n* 6 Engraved Whiskey Stones (1&quot; x 1&quot;)\n* 1 Engraved Wood Gift Box\n* 1 Muslin Storage Bag\n* 1 Instructions Card\n\nThese gift sets are fully customizable so I can engrave anything on the Stones and Box or you can keep it the same as the item pictured, just send me your engraving instructions in the &quot;Notes to Seller&quot; section at check out or send me an Etsy Convo.\n\n**Please note the listing is for only ONE SIDE of each stone engraved, they can be the same as the main picture or please feel free to switch out any of the images or words and replace them with initials or names etc... Please specify any changes in the Notes to Seller at checkout**\n\nSome font examples can be seen in the item pictures.  You can also choose the color of the box from the drop down menu at check out.  You can add names to the box also.\n\n**What are Whiskey Stones?**\n\nWhiskey Stones, are a new way to chill your whiskey or wine without diluting your drink. Ice cubes water down your whiskey and leave a moist layer of condensation on your glass, whiskey stones have all the benefits of ice without the hassles.\n\nWhiskey Stones are made out of cubes of solid soapstone which is softer than granite and won’t scratch your glass. Soapstone retains its temperature much longer than ice, so it will cool your whiskey or liquor of your choice and provide a more sustained chill. Whiskey Stones are also non-porous, odorless and tasteless so they won’t alter your favorite drinks. Whiskey Stones can also be used to warm your drinks and work well with non-alcoholic beverages too.\n\nStill thinking and in need of more ideas?  Check out my shop via the link below for more great gifts for Men.  I add new items weekly so please Favorite my shop so you are the first to see the new arrivals.\nhttps://www.etsy.com/shop/TheUltimateManShop",
